- L’administration des douanes et impôts indirects est chargée de la liquidation et du
recouvre ment des taxes intérieures de consommation applicables aux catégories suivantes de marchandises et
d’ouvrages importés ou produits dans le territoire assujetti :
1 - les limonades, eaux gazeuses ou non gazeuses, eaux minérales, eaux de table ou autres, aromatisées ou
non aromatisées ;
2 - les bières ;
3 - les vins et alcools ;
4 - abrogé ;
5 - les produits éner gétiques et les bitumes ;
6 - (abrogé) ;
7 - les ouvrages de platine, d’or et d’ar gent;
8 - les tabacs manufacturés ;
9- les liquides pour char ger ou rechar ger les appareils électroniques dits « cigarettes électroniques » et
appareils similaires, ainsi que les produits connexes de tabac pour pipe à eau ( muassel  sans tabac);
10- les pneumatiques même montés sur jantes ;
11- les articles, appareils et équipements fonctionnant à l’électricité;
12- les appareils électroniques ;

Art. 51. – 1° Les titres légaux sont les suivants :
a) pour le platine : 950 millièmes;
b) pour l'or :
1er titre : 920 millièmes;
2e titre : 840 millièmes;
3e titre : 750 millièmes;
c) pour l'ar gent :
1er titre : 950 millièmes;
2e titre : 800 millièmes;
2° Il est accordé une tolérance de 10 millièmes pour les ouvrages en platine, de 3 millièmes pour les
objets en or plein et de 5 millièmes pour les objets en ar gent.
3° Les bijoux creux et soudés en or ou en argent bénéficient d'une tolérance de 20 millièmes, sous réserve
que le métal constitutif, c'est-à-dire la partie pleine sans soudure, soit au titre légal.
4° L'iridium et les métaux rares associés au platine dans les gisements sont comptés comme platine.
